// HARD
/**
 * @param {number[]} nums
 * @param {number} k
 * @return {number}
 */
var smallestDistancePair = function (nums, k) {
  // sort it first
  nums.sort((a, b) => a - b)
  class MaxHeap {
    constructor(k) {
      this.heap = [];
      this.k = k
    }

    getParentIndex(index) {
      return Math.floor((index - 1) / 2);
    }

    getLeftChildIndex(index) {
      return 2 * index + 1;
    }

    getRightChildIndex(index) {
      return 2 * index + 2;
    }

    swap(index1, index2) {
      [this.heap[index1], this.heap[index2]] = [this.heap[index2], this.heap[index1]];
    }

    insert(value) {
      if (this.heap.length < k) {
        this.heap.push(value);
        this.heapifyUp();
        return;
      }
      const largestIndex = this.heap[0]
      if (value < largestIndex) {
        this.heap[0] = value
        this.heapifyDown(0)
      }
    }

    heapifyUp() {
      let index = this.heap.length - 1;
      while (this.getParentIndex(index) >= 0 && this.heap[this.getParentIndex(index)] < this.heap[index]) {
        this.swap(this.getParentIndex(index), index);
        index = this.getParentIndex(index);
      }
    }

    heapifyDown(index) {
      let largest = index;
      const leftChildIndex = this.getLeftChildIndex(index);
      const rightChildIndex = this.getRightChildIndex(index);

      if (leftChildIndex < this.heap.length && this.heap[leftChildIndex] > this.heap[largest]) {
        largest = leftChildIndex;
      }

      if (rightChildIndex < this.heap.length && this.heap[rightChildIndex] > this.heap[largest]) {
        largest = rightChildIndex;
      }

      if (largest !== index) {
        this.swap(index, largest);
        this.heapifyDown(largest);
      }
    }

    peek() {
      return this.heap[0];
    }

    size() {
      return this.heap.length;
    }

    isEmpty() {
      return this.heap.length === 0;
    }
  }
  const heap = new MaxHeap(k)

  let tempIndex = 1;
  while (heap.size() < k) {
    for (let i = 0; i < tempIndex; i++) {
      heap.insert(Math.abs(nums[i] - nums[tempIndex]))
    }
    tempIndex++
  }

  const searchMaxSmaller = (value, outer) => {
    let l = 0
    let r = outer
    let result = -1
    while (l <= r) {
      const mid = (l + r) >> 1
      if (nums[mid] <= value) {
        result = mid
        l = mid + 1
      } else {
        r = mid - 1
      }
    }
    return result
  }
  const searchMinLarger = (value, outer) => {
    if (value < 0) return 0
    let l = 0;
    let r = outer
    let result = -1
    while (l <= r) {
      const mid = (l + r) >> 1
      if (nums[mid] >= value) {
        result = mid
        r = mid - 1
      } else {
        l = mid + 1
      }
    }
    return result
  }



  // the abs value need to < maxValue
  // 0 < nums[tempIndex] - x < maxValue ->  nums[tempIndex] - maxValue < x <= nums[tempIndex]
  // 0 <= x - nums[tempIndex] < maxValue -> nums[tempIndex] <= x < maxValue - nums[tempIndex]
  // nums[tempIndex] - maxValue < x < maxValue + nums[tempIndex]
  // starting at temp index 
  for (let i = tempIndex; i < nums.length; i++) {
    let j = i - 1
    while (j >= 0 && nums[i] - nums[j] < heap.peek()) {
      heap.insert(Math.abs(nums[i] - nums[j]))
      j--
    }
  }
  return heap.peek()
};
